import React from 'react';
import charactersImage from '/J';
import rulesImage from '../../../assets/regras.png';
import '../styles/image-button.css';

const ImageButton = ({actualImage, changeImage}) => {
  let value = actualImage ? charactersImage : rulesImage;
  return (
    <div className="image-container">
      <img src={value} 
           alt="Characters playing jokenpo" 
           onClick={() => changeImage(!actualImage)}
      />
    </div>
  );
}

export default ImageButton;
